import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useHistory, useLocation } from 'react-router-dom';

const weatherKey = `a9f1bf42965f0a8fe32093676aa04e78`;

function Home() {
    const history = useHistory();
    const location = useLocation();

    const [weatherData, setWeatherData] = useState(null);
    const [city, setCity] = useState("Manila");
    const [date, setDate] = useState('');
    const [time, setTime] = useState('');
    const [loading, setLoading] = useState(false);

    useEffect(() => {
        const searchParams = new URLSearchParams(location.search);
        const cityFromUrl = searchParams.get("city");
        if (cityFromUrl && cityFromUrl !== city) {
            setCity(cityFromUrl);
        }
    }, [location, city]);

    useEffect(() => {
        setLoading(true);
        axios
            .get(`https://api.openweathermap.org/data/2.5/weather?q=${city}&units=metric&appid=${weatherKey}`)
            .then(function (response) {
                setLoading(false);
                const weather = response.data;
                setWeatherData(weather);

                const timezone = weather.timezone;
                const cityDateTime = new Date().toLocaleString("en-US", { timeZone: timezone });
                setDate(new Date(cityDateTime).toLocaleDateString());
                setTime(new Date(cityDateTime).toLocaleTimeString());
            })
            .catch(function (error) {
                setLoading(false);
                console.error("Error fetching weather data: ", error);
            });
    }, [city]);

    const handleCityChange = (city) => {
        setCity(city);
        history.push(`/?city=${city}`);
    };

    return (
        <div className="contentWrapper">
            {loading && <p>Loading...</p>}

            <div className="topTitle">
                <div className="date">{date}</div>
                <h2 className="city"> {city} </h2>
                <div className="time">{time}</div>
            </div>

            <main className="Home">
                {weatherData && (
                    <div className="Head" style={{
                        background: `radial-gradient(rgba(${
                            parseInt(weatherData.main.temp) > 23 ? "244, 242, 233" :
                            parseInt(weatherData.main.temp) >= 20 ? "146, 220, 154" :
                            "89, 212, 228"
                        }, ${parseInt(weatherData.clouds.all) / 250 }), rgba(${
                            parseInt(weatherData.main.temp) > 23 ? "240, 168, 101" :
                            "240, 168, 101"
                        }, ${parseInt(weatherData.clouds.all) / 150 + .5 }))`
                    }}>
                        <div className="WeatherInfo_Display">
                            <div className="Icon"><WeatherImage weatherType={weatherData.weather[0].description} /></div>
                            <h3 className="weatherInfo_Current">{Math.round(weatherData.main.temp)}°</h3>
                            <p className="weatherInfo_Type">{weatherData.weather[0].description}</p>
                        </div>

                        <div className="WeatherInfo">
                            <div className="WeatherInfoSection">
                                <p className="WeatherDetails">High Temperature</p>
                                <p className="Numbers">{Math.round(weatherData.main.temp_max)}°</p>
                            </div>

                            <div className="WeatherInfoSection">
                                <p className="WeatherDetails">Low Temperature</p>
                                <p className="Numbers">{Math.round(weatherData.main.temp_min)}°</p>
                            </div>

                            <div className="WeatherInfoSection">
                                <p className="WeatherDetails">Cloudiness</p>
                                <p className="Numbers">{weatherData.clouds.all}%</p>
                            </div>

                            <div className="WeatherInfoSection">
                                <p className="WeatherDetails">Humidity</p>
                                <p className="Numbers">{weatherData.main.humidity}%</p>
                            </div>

                            <div className="WeatherInfoSection">
                                <p className="WeatherDetails">Wind Speed</p>
                                <p className="Numbers">{weatherData.wind.speed} m/h</p>
                            </div>
                        </div>
                    </div>
                )}
            </main>

            <footer className="navBar">
                <nav>
                    <button onClick={() => handleCityChange('Manila')}>Manila</button>
                    <button onClick={() => handleCityChange('Honolulu')}>Honolulu</button>
                    {/* Add more buttons for other cities */}
                </nav>
            </footer>
        </div>
    );
}

export default Home;
